  [],\n\t\"revision_timestamp\": \"2016-09-05T21:02:10.667485\",\n\t\"name\": \"gulf-of-alaska-acoustic-trawl-surveys-of-walleye-pollock-dy1201-ek60\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Midwater Assessment and Conservation
  Engineering (MACE) program of NOAA National Marine Fisheries Service (NMFS), Alaska
  Fisheries Science Center (AFSC) conducted acoustic-trawl (AT) stock assessment surveys
  in the Gulf of Alaska (GOA) during the winter of 2012 to estimate the distribution
  and abundance of walleye pollock (Theraga chalcogramma). The vessel departed Kodiak,
  Alaska on 13 February, conducted EK60 echosounder system calibration on 14 February,
  then proceeded to the start of the first survey (Sanak Trough, 15 February). The
  vessel then proceeded to the Shumagin Islands and conducted surveys at Shumagin
  Trough, Stepovak Bay, Renshaw Point, Unga Strait, and West Nagai Strait, 16-19 February.
  The vessel conducted multibeam echosounder surveys of select locations and deployed
  ARGO drifters 19-22 February and returned to Kodiak on 22 February. The survey was
  conducted aboard NOAA Ship Oscar Dyson, a 64 meter stern trawler equipped with acoustic
  and oceanographic instrumentation.\",\n\t\"license_title\": null,\n\t\"extras\":
